import React, { useState, useEffect } from 'react';
import { api } from '../../services/api';
import { getDeviceIdentifier } from '../../utils/deviceIdentifier';
import { useNavigate,Link } from 'react-router-dom';
import { CommonFormTextInput } from '../common/inputs';
import { CommonButtonSolidBlue } from '../common/buttons';
const Register: React.FC = () => {
    const navigate=useNavigate()
    const [formData, setFormData] = useState({
        username: '',
        email: '',
        password: '',
        phoneNumber: '',
        deviceIdentifier: '',
        lastKnownIP: '',
        userAgent: '',
        browserName: '',
        operatingSystem: '',
    });

    useEffect(() => {
        const fetchAdditionalData = async () => {
            try {
                const identifier = await getDeviceIdentifier();
                const userAgent = navigator.userAgent;
                const lastKnownIP = await fetchPublicIP();
                const browserName = getBrowserName(userAgent);
                const operatingSystem = getOSName(userAgent);

                setFormData((prev) => ({
                    ...prev,
                    deviceIdentifier: identifier,
                    userAgent,
                    lastKnownIP,
                    browserName,
                    operatingSystem,
                }));
            } catch (error) {
                console.error('Failed to fetch device information:', error);
            }
        };

        fetchAdditionalData();
    }, []);

    const fetchPublicIP = async (): Promise<string> => {
        try {
            const response = await fetch('https://api.ipify.org?format=json');
            const data = await response.json();
            return data.ip;
        } catch (error) {
            console.error('Failed to fetch IP address:', error);
            return '';
        }
    };

    const getBrowserName = (userAgent: string): string => {
        if (userAgent.includes('Edg/')) return 'Microsoft Edge';
        if (userAgent.includes('Chrome/')) return 'Google Chrome';
        if (userAgent.includes('Firefox/')) return 'Mozilla Firefox';
        if (userAgent.includes('Safari/') && !userAgent.includes('Chrome/')) return 'Apple Safari';
        return 'Unknown';
    };

    const getOSName = (userAgent: string): string => {
        if (userAgent.includes('Windows')) return 'Windows';
        if (userAgent.includes('Mac')) return 'MacOS';
        if (userAgent.includes('Linux')) return 'Linux';
        if (userAgent.includes('Android')) return 'Android';
        if (userAgent.includes('iPhone') || userAgent.includes('iPad')) return 'iOS';
        return 'Unknown';
    };

    const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e: React.FormEvent) => {
        e.preventDefault();
        try {
            const response = await api.post('http://localhost:5219/api/Auth/register', formData);
            console.log('Registration successful:', response.data);
            if (response.data.needsVerification) {
                // Use navigate for redirect
                navigate('/verify-otp', { state: { username: formData.username } });
            } else {
                console.log('Login successful:', response.data);
            }
        } catch (error) {
            console.error('Registration failed:', error);
        }
    };

    return (
        <div className="flex items-center justify-center min-h-screen bg-[color:var(--lightBackgroundColor)]">
          <div className="flex-col shadow-md p-6 bg-white rounded-md w-full max-w-md">
            <div className="flex items-center justify-center mb-4">
              <img
                src="/asp.net.png"
                alt="ASP.NET Logo"
                className='hover:scale-105 duration-300'
                style={{ width: "80px", height: "80px" }}
              />
              <div className="flex items-center p-2">
                <h1>+</h1>
              </div>
              <img
                src="/react.png"
                alt="React Logo"
                className='hover:scale-105 duration-300'
                style={{ width: "80px", height: "80px" }}
              />
            </div>
            <form className="flex flex-col gap-4" onSubmit={handleSubmit}>
              <CommonFormTextInput
                title="Username"
                
                value={formData.username}
                onChange={handleChange}
                required={true}
              />
              <CommonFormTextInput
                title="Email"
                
                value={formData.email}
                onChange={handleChange}
                required={true}
              />
              <CommonFormTextInput
                title="Password"
               
                value={formData.password}
                onChange={handleChange}
                required={true}
              />
              <CommonFormTextInput
                title="Phone Number"
                
                value={formData.phoneNumber}
                onChange={handleChange}
                required={true}
              />
              <CommonButtonSolidBlue type="submit" text="Register" />
              <div className="text-sm text-center">
                Already have an account?{" "}
                <Link
                  to="/login"
                  className="font-semibold text-[color:var(--mainTitleColor)] hover:p-1 hover:text-[color:var(--primaryColor)]"
                >
                  Login
                </Link>
              </div>
            </form>
          </div>
        </div>
      );
    };
    
    
    
    export default Register;
